import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Completed = () => {
  const [projects, setProjects] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchProjects = async () => {
      try {
        const res = await fetch('http://localhost:2000/api/projects/completed');
        const data = await res.json();
        if (data.projects) {
          setProjects(data.projects);
        }
      } catch (err) {
        console.error('❌ Failed to fetch projects:', err);
      }
    };

    fetchProjects();
  }, []);

  return (
    <div className="completed-projects-page">
      {/* ✅ Back Button */}
      <button onClick={() => navigate('/projects')} className="back-button">
        ← Back
      </button>

      <h1 className="header">Completed Projects</h1>

      <ul className="project-list">
        {projects.map((project, index) => (
          <li key={index} className="project-card">
            <h2>{project.projectName || 'Unnamed Project'}</h2>

            <form className="audit-form">
              <label><strong>Project ID:</strong></label>
              <input type="text" value={project.projectId || ''} readOnl />

              <label><strong>Client Name:</strong></label>
              <input type="text" value={project.clientName || ''} readOnly />

              <label><strong>Audit Type:</strong></label>
              <input type="text" value={project.auditType || ''} readOnly />

              <label><strong>Start Date:</strong></label>
              <input type="date" value={project.startDate?.split('T')[0] || ''} readOnly />

              <label><strong>End Date:</strong></label>
              <input type="date" value={project.endDate?.split('T')[0] || ''} readOnly />

              <label><strong>Auditors Involved:</strong></label>
              <textarea value={project.auditors?.join(', ') || ''} readOnly />

              <label><strong>Key Findings / Summary:</strong></label>
              <textarea value={project.findings || ''} readOnly />

              <label><strong>Compliance Status:</strong></label>
              <input type="text" value={project.complianceStatus || ''} readOnly />

              <label><strong>Recommendations:</strong></label>
              <textarea value={project.recommendations || ''} readOnly />

              {project.reportFileUrl && (
                <div>
                  <strong>Report:</strong>{' '}
                  <a href={project.reportFileUrl} target="_blank" rel="noopener noreferrer">
                    Download PDF
                  </a>
                </div>
              )}
            </form>

            <hr />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Completed;
